import React, { useEffect, useState } from 'react';
import { getUserGrievances } from '../services/api';

const Profile = () => {
  const [user, setUser] = useState({ name: '', email: '' });
  const [grievances, setGrievances] = useState([]);

  useEffect(() => {
    const fetchUserGrievances = async () => {
      const response = await getUserGrievances();
      setGrievances(response.data.grievances);
      setUser({ name: response.data.name, email: response.data.email });
    };

    fetchUserGrievances();
  }, []);

  return (
    <div className="profile-container">
      <h2>Profile</h2>
      <p>Email: {user.email}</p>
      <h3>Your Grievances:</h3>
      {grievances.length > 0 ? (
        <ul>
          {grievances.map((grievance, index) => (
            <li key={index}>
              <strong>Type:</strong> {grievance.type}<br />
              <strong>Title:</strong> {grievance.title}<br />
              <strong>Description:</strong> {grievance.description}<br />
              <strong>Status:</strong> {grievance.status}<br /><br />
            </li>
          ))}
        </ul>
      ) : (
        <p>No grievances submitted.</p>
      )}
    </div>
  );
};

export default Profile;
